import React from 'react';
import './App.css';
import Header from "./components/Header";
import Baner from "./components/Baner";
import ZaNas from './components/ZaNas';
import Edukacija from './components/Edukacija';
import Nastani from './components/Nastani';
import Coworking from "./components/Coworking";
import Prostor from "./components/Prostor";
import Partneri from './components/Partneri';

function App() {
  return (
    <div className="App">
   <Header />
   <Baner />
   <ZaNas />
   <Edukacija />
   <Nastani />
   <Coworking />
   <Prostor />
   <Partneri />
    </div>
  );
}

export default App;
